import React from 'react';
import UserComponent from './components/UserComponent';
import AddUser from './components/AddUser';

class UserHome extends React.Component {
	render(){
		return(
			<div>
				<UserComponent/>
				<AddUser/>
			</div>
		)
	}
}

export default UserHome;
